display: flex;
flex-direction: column;
justify-content: center;
aligh-items: center;
background-color: var(--peach);
`

const Services = () => {
  return<Container >
      <Steps />
      <Charges />
      <Divider />
      <Brands />
    </Container>;
};

export default Services;
